                <img src={user.author.avatar} className="" alt="" />
                <b>{user.author.name}</b>   {user.author.nickname}   {user.date}
            
            
                <img src={user.photo} className="" alt="" />
                {user.author.name}
                {user.date}
            </div>

    </>)
}
